import React from 'react';
import "./Home.css";

class Home extends React.Component {
  render() {
    return (
      <section className='container'>
        <div className="home__title">
          <h1># Z E R O W A S T E</h1>
          <h4>Do you know <span>sustainable</span> fashion?</h4>
        </div>
      </section>
    );
  };
} 

export default Home;
